registerPerson.expectJsonc:
[
    {
        "name": "email",
        "type": "text",
        "label": "Email address",
        "required": true
    },
    {
        "name": "first_name",
        "type": "text",
        "label": "First name",
        "required": true
    },
    {
        "name": "last_name",
        "type": "text",
        "label": "Last name"
    },
    {
        "name": "webinar_id",
        "type": "select",
        "label": "Webinar",
        "required": true,
        "options": "rpc://getWebinars",
        "editable": true
    },
    {
        "name": "schedule",
        "type": "text",
        "label": "Schedule",
		"help":"Example: 0, 1, 2 ... Attendee Schedule index number, can be obtained from other modules.",
        "required": true
    },
    {
        "name": "ip_address",
        "type": "text",
        "label": "IP address"
    },
    {
        "name": "phone_country_code",
        "type": "number",
        "label": "Phone country code",
        "help": "Without +"
    },
    {
        "name": "phone",
        "type": "number",
        "help": "only numbers",
        "label": "Phone"
    }
]

